  if (arg[0]) {
    casadi_copy(arg[0], 12, d_nlp.z);
  } else {
    casadi_clear(d_nlp.z, 12);
  }
  if (arg[6]) {
    casadi_copy(arg[6], 12, d_nlp.lam);
  } else {
    casadi_clear(d_nlp.lam, 12);
  }
  if (arg[7]) {
    casadi_copy(arg[7], 44, d_nlp.lam+12);
  } else {
    casadi_clear(d_nlp.lam+12, 44);
  }
  if (arg[2]) {
    casadi_copy(arg[2], 12, d_nlp.lbz);
  } else {
    casadi_fill(d_nlp.lbz, 12, -casadi_inf);
  }
  if (arg[3]) {
    casadi_copy(arg[3], 12, d_nlp.ubz);
  } else {
    casadi_fill(d_nlp.ubz, 12, casadi_inf);
  }
  if (arg[4]) {
    casadi_copy(arg[4], 44, d_nlp.lbz+12);
  } else {
    casadi_fill(d_nlp.lbz+12, 44, -casadi_inf);
  }
  if (arg[5]) {
    casadi_copy(arg[5], 44, d_nlp.ubz+12);
  } else {
    casadi_fill(d_nlp.ubz+12, 44, casadi_inf);
  }
  d.prob = &p;
  p.sp_h = casadi_s31;
  p.sp_a = casadi_s19;
  p.merit_memsize = 4;
  p.max_iter_ls = 3;
  p.nlp = &p_nlp;
  casadi_sqpmethod_init(&d, &iw, &w);
  m_w = w;
  m_iw = iw;
  casadi_clear(d.dx, 12);
